import React from "react";
import Tweet from "./Tweet";

const TweetList = (props) => {
  const name = "Dev Ed";
  const message = "I want to fuck up you now";
  return (
    <div className="fuckoff">
      {props.tweets.map((tweet) => (
        <Tweet
          auther={props.name}
          post={tweet}
          tweets={props.tweets}
          setTweets={props.setTweets}
          key={props.tweets.id}
        />
      ))}
    </div>
  );
};

export default TweetList;
